  input: TEXT,F3A,,"This amendment is in response to the Commission's November 9,
    2004 letter.  The first issue addresse is three checks that were reported on this
    report, but 48 Hour Notices were not filed.  The Committee utilized volunteers
    to perform data entry of all contributions.  It is the policy of the Committee
    to enter contributions by receipt date; however, the volunteers that entered these
    checks inadvertently entered them by check date.  The American Veterinary Medical
    Association PAC check was actually written on 2/13/04 but was not received and
    deposited by the Committee until 8/31/04.  The Equifax PAC check was dated 7/12/04
    but not received and deposited by the Committee until 7/20/04.  The Halliburton
    Company PAC check was dated 7/12/04 but not received and deposited by the Committee
    until 7/19/04.  All of the actual receipt dates feel outside the 48 Hour reporting
    period.  The second issue addressed is two contributions reported on 48 Hour notices
    that do not appear in the report. The 7/16/04 contribution from the Associated
    General Contractors of American PAC was reported as a contribution from AGC on
    its deposit date of 7/19/04 rather the receipt date of 7/16/04.  The 7/7/04 James
    Reynolds III contribution was reported on its deposit date of 7/22/04 rather than
    the receipt date.  All dates have been amended to reflect the above."
